Pride month is a great month to follow the great work happening among transgender and non-binary leaders, educators, writers and content creators.  I am often asked to speak on behalf of the transgender community as a whole. And I love speaking about my experience as an artist, and a white, middle-aged nonbinary transdad. But the beauty of our community is that it is incredibly diverse.  Greatness comes from the intersections of identities among us.  We queers are challenging the narrative to expand just by being visible. 

Here are a few of the folks who inspire me to think beyond my own experience of queerness every day. 

I hope you add to your follows, invite them to your paid speaking gig, invest in their Patreon, and support their calls to action.  These are people doing great work making a better world for all of us and representing the divine expanse of queer life among us. 

