A while back I curated my feed to fill my social experience with visions of queerness that give me hope.  It’s a constant battle with algorithms that often downplay the great works being done by queer leaders.  But it’s well worth it. 

I wanted to share some of the folks on IG who remind me daily to work hard at creating a better world and be an even better person every day while fighting for it.  These folks make me proud on pride month. 

Add them to your feed, and your Patreon, and your next paid speakers panel. 

Thank you.

@kwaai_diva 
@portia.noir 
@ninawest @decolonizing_fitness 
@thechrismosier @alexjenny_ 
@themrmilan @thedominiquemorgan

The beauty of our very diverse LGBTQ+ community is so powerful to behold.  We queers are so  good at expanding the beauty this world holds. 

Sigh.  Queer art makes me so proud. 

Knowing so many queer artists has helped me grow as a painter and designer and in my queer identity.  Extra special shout out to the many folks here who have been with me as all three of those identities evolve. 

Please give them a follow, a grant, a gallery exhibition and #buyqueerart 

